import styles from './LoginForm.module.css';
import { Link } from 'react-router-dom';

export function LoginForm(){
    function show(){
        var input = document.getElementById('password');
        var button = document.getElementById('show');
        if(button.classList.contains('show')){
            button.classList.remove('show');
            input.type = 'password';
        }
        else{
            button.classList.add('show');
            input.type = 'password';
        }
    }

    return(
        <div className={styles.content}>
            <div className={styles.nav}>
                <div className={styles.navButton}>Log in</div>
                <div className={styles.navButton}>Create Account</div>
            </div>
            <h1 className={styles.title}>Log in to Tech Heim</h1>
            <div className={styles.form}>
                <input type="email" className={styles.input} placeholder='Email'/>
                <input type="password" className={styles.input} placeholder='Password' id='password'/>
                <div className={styles.showPassword} onClick={show} id='show'></div>
            </div>
        </div>
    );
}
